// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract BlockFeit {

    struct Product {

        string id;
        string name;
        string width;
        string height;
        string time_stamp;
        string batch;
        string ownwer;
    }

    struct Customer {

        string id;
        string name;
        string phone_no;
        string email;
        Product[] purchesed;
    }

     struct Retailer {

        string id;
        string name;
        string phone_no;
        string email;
        string location;
        uint remaining;
        uint sold;
        Product[] available;
        bool present;
    }

    string private manufacturer;
    string brand;
    string location;
    uint total_manufacturered;
    Retailer tempRetailer;
    Customer tempCustomer;
    Product[] tempProducts;
    Product tempProduct;
    uint indx;
    Product[] manufacturered;
    
    mapping(string => Product) productMapping;
    mapping(string => Customer) customers;
    mapping(string => Retailer) retailers;


    function sellProductToCustomer(string memory _seller_id, string memory _customer_id) public {

        delete tempRetailer.available;
        tempRetailer =  retailers[_seller_id];
        delete tempCustomer.purchesed;
        tempCustomer = customers[_customer_id];
        tempProduct = tempRetailer.available[0];

        for(uint i = 0; i < tempRetailer.available.length-1; i++) {

            tempRetailer.available[i] = tempRetailer.available[i+1];
        }

        tempRetailer.available.pop();
        retailers[_seller_id] = tempRetailer;
        customers[_customer_id].purchesed.push(tempProduct);
    }





    constructor() public{

        total_manufacturered = 0;
        indx = 0;
    }

    function addManufacturer(string memory _manufacturer, string memory _location, string memory _brand) public {

        manufacturer = _manufacturer;
        location = _location;
        brand = _brand;

    }

    
    function addProduct(string memory _id, 
                        string memory _name, 
                        string memory _width, 
                        string memory _height,
                        string memory _time_stamp,
                        string memory _batch,
                        string memory _owner
                        ) public {

            Product memory product;
            product.id = _id;
            product.name = _name;
            product.width = _width;
            product.height = _height;
            product.time_stamp = _time_stamp;
            product.batch = _batch;
            product.ownwer = _owner;

            productMapping[_id] = product;
            manufacturered.push(product);
    }

    function getProductDetail(string memory _product_id) public view returns(string memory, string memory, string memory) {

        return(productMapping[_product_id].id, productMapping[_product_id].name, productMapping[_product_id].ownwer);
    }


    function addCustomer(string memory _id,
                        string memory _name,
                        string memory _phone_no,
                        string memory _email
                        ) public {

            tempCustomer.id = _id;
            tempCustomer.name = _name;
            tempCustomer.phone_no = _phone_no;
            tempCustomer.email = _email;
            delete tempCustomer.purchesed;
            customers[_email] = tempCustomer;
    }

    string MSG = "Retailer Does not Exist";
    function sellProductsToRetailer (string memory _id, uint _quantity)  public returns(string memory) {
      
        Retailer memory retailer = retailers[_id];
        if((_quantity+indx) > manufacturered.length) {

            MSG = "Insufficient products";
            return (MSG);
        }
        else if(retailer.present == false) {

            return (MSG);
        }

        delete tempRetailer.available;
        
        
        tempRetailer.id = retailer.id;
        tempRetailer.name = retailer.name;
        tempRetailer.phone_no = retailer.phone_no;
        tempRetailer.email = retailer.email;
        tempRetailer.location = retailer.location;
        tempRetailer.present = true;

        for(uint tt = 0; tt < retailer.available.length;  tt++) {

            Product memory p = retailer.available[tt];
            tempRetailer.available.push(p);
        }

        for(uint i = 0; i < _quantity; i++) {

            // Product memory present = retailer.available[i];
            Product memory present = manufacturered[indx];
            present.ownwer = _id;
            productMapping[present.id].ownwer = _id;
            indx++;
            tempRetailer.available.push(present);
        }
        retailers[_id] = tempRetailer;
        MSG = "Productes Added successfully";
        return MSG;
    }


   function addRetailer(string memory _id,
                        string memory _name,
                        string memory _phone_no,
                        string memory _email,
                        string memory _location) public  {


            tempRetailer.id = _id;
            tempRetailer.name = _name;
            tempRetailer.phone_no = _phone_no;
            tempRetailer.email = _email;
            tempRetailer.location = _location;
            tempRetailer.present = true;
            retailers[_id] = tempRetailer;
    }





    function getRetailerDetails(string memory retailer_id) public view returns(string memory, string memory, string memory, uint) {


        return(retailers[retailer_id].name, retailers[retailer_id].email, retailers[retailer_id].location, retailers[retailer_id].available.length);

    }


   
   function getOwnerOfProduct(string memory product_id) public view returns(string memory, string memory) {

        return(productMapping[product_id].name, productMapping[product_id].ownwer);
    }


    function verifyOwnership(string memory owner_id) public view returns(bool) {

        return(keccak256(bytes(productMapping[owner_id].ownwer)) == keccak256(bytes(owner_id)));

    }
}
